import React from 'react';
import '../stylesheets/Selector.css';

/*Objetos*/
const d = document;
const selectBtn = d.querySelectorAll('.data-selector label');


/*Utilidad*/


function Selector(props){
    return(
        <div className='data-selector'>
            <input type='checkbox' value={props.value} id={props.id}></input>
            <label name='choiseBtn' className={`props.func`+`props.id`} htmlFor={props.id}>{props.children}</label>
        </div>
    )
}





export default Selector;
